import React from 'react'
import styled from 'styled-components'

const Title = styled.h2`
    background: linear-gradient(84deg,#da1bca,#7b2bf9,#7b2bf9,#36cef0,#f7cc97);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    text-align: center;
    font-size: 30em;
`

function Careers2() {
  return (
    <div>
        <Title>Make chains as easy to deploy as smart contracts</Title>
        <h3>Join our team of leading engineers, researchers and entrepreneurs in pioneering the first modular blockchain design.</h3>
    </div>
  )
}

export default Careers2
